import React, { Component } from "react";

class LogInButtons extends Component {
  constructor() {
    super();
    this.state = {
      showMe: true
    };
  }

  hideMe() {
    this.setState({
      showMe: false
    });
  }
  render() {
    return (
      <>
        {this.state.showMe ? (
          <div>
            <button onClick={() => this.hideMe()}>Log In</button> |{" "}
            <button>Sign up</button>
          </div>
        ) : null}
      </>
    );
  }
}

export default LogInButtons;

